import * as React from 'react';

import { map } from 'lodash-es';
import moment from 'moment';

import { styled } from '@mui/material/styles';

import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Typography from '@mui/material/Typography';


const bgBase64 = "data:image/png;base64,";

const Item = styled(Paper)(({ theme }) => ({
  width: 340,
  height: 208,
  backgroundColor: '#E3F5FE',
  backgroundImage: `url(${bgBase64})`,
  backgroundSize: 'cover',
  backgroundPosition: 'center',
  padding: theme.spacing(1),
  color: theme.palette.text.secondary,
  margin: '1% 2%',
  position: 'relative',
}));


const Card = ({ details }) => {
  return (
    <Item elevation={0} className={`MuiTypography-${details.fuel.toLowerCase()}`}>
      <Box sx={{ marginTop: '40px' }}></Box>

      <Typography component='div' color='#10325E' fontSize='20px' align='right' className='vehicle-no'>{ details.vehicle }</Typography>

      <Box sx={{ display: 'flex', alignItems: 'baseline', justifyContent: 'flex-end' }}>
        <Typography component='div' color='#10325E' fontSize='16px' align='right' className='vehicle-type'>{ details.type }</Typography>
        <Typography component='div' color='#10325E' fontSize='14px' mx={1}>&ndash;</Typography>
        <Typography component='div' color='#10325E' fontSize='14px' align='right' className='vehicle-name'>{ details.name }</Typography>
        <Typography component='div' color='#10325E' fontSize='14px' mx={1}>&ndash;</Typography>
        <Typography component='div' color='#10325E' fontSize='14px' align='right' className='vehicle-validity'>{ moment(details.validity).format('DD/MM/YYYY') }</Typography>
      </Box>

      <Box sx={{ display: 'flex', alignItems: 'baseline', justifyContent: 'flex-end' }}>
        <Typography component='div' color='#10325E' fontSize='14px' className='fuel-type'>{ details.fuel }</Typography>
        <Typography component='div' color='#10325E' fontSize='12px' mx={1}>&ndash;</Typography>
        <Typography component='div' color='#10325E' fontSize='12px' align='right' className='liters-no'>{ details.liters } liters / Month</Typography>
      </Box>

      <Box sx={{ marginTop: '2px', marginLeft: '2px' }}>
        <Typography component='div' color='#FFFFFF' fontSize='14px' className='vehicle-owner'>{ details.owner }</Typography>
        <Typography component='div' color='#FFFFFF' fontSize='12px' fontWeight='bold' className='owner-dept'>{ details.department }</Typography>
        <Typography component='div' color='#FFFFFF' fontSize='12px' fontWeight='bold' className='owner-location'>{ details.location }</Typography>
      </Box>

      <Box sx={{ display: 'flex', alignItems: 'baseline', justifyContent: 'space-between', marginTop: '7px' }}>
        <Typography component='div' color='#E3F5Fe' fontSize='10px' fontStyle='italic' className='card-validity'>Card valid upto { moment().add(3, 'year').endOf('year').format('DD MMM YYYY') }</Typography>
        <Typography component='div' color='#E3F5Fe' fontSize='10px' className='card-sign'>Manager Transport</Typography>
      </Box>
    </Item>
  );
};


const CardsToPrint = React.forwardRef((props, ref) => {
  const data = props.data;

  return (
    <div ref={ref} className='fuel-card'>
      <Box sx={{ display: 'flex', justifyContent: 'center', flexDirection: 'row', flexWrap: 'wrap' }}>
        {map(data, (item, index) => (<Card key={index} details={item} />))}
      </Box>
    </div>
  );
});


export default CardsToPrint;
